import './styles.css'
type InputPropTypes={
    value:string;
    onChange :(e) => void;
    label :string;
    placeholder : string;
    type: 'text'|'password'

}
const Input :React.FC <InputPropTypes> = ({label,value,type,placeholder,onChange})=>{
return(
    <div>
        <div className='relative'>
        <input className='input'type={type} placeholder={placeholder} value={value} onChange={onChange}/>
        <label>{label}</label>
        </div>

    </div>
)
}

export default Input;
